import React from 'react';
import logo from './logo.svg';
import './App.css';

const elements = React.createElement(
  'div',
  { className: 'App-without-jsx' },
  React.createElement(
    'header',
    { className: 'App-header' },
    React.createElement(
      'img',
      { className: 'App-logo', src: logo, alt: 'Logo-no-jsx' }
    )
  )
);

const properties = { className: 'App-logo', src: logo, alt: 'Logo-no-jsx'  };

function App() {
  // return elements;
  return (
    <div className="App">
      <header className="App-header">
        <img {...properties} />
        <p>{Math.random()}</p>
        {/* <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a> */}
      </header>
    </div>
  );
}

export default App;
